import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import FilterCategory from './components/FilterCategory';

function App() {
  return (
    <div>
      <Router>
        <Route path="/" component={FilterCategory} />
      </Router>
    </div>
  );
}

export default App;
